import React, { useEffect, useState } from "react";
import axios from "axios";
const locationRes = []
export default function Weather(props) {
  const [weather, setWeather] = useState(true);
  //Test grab the weather data
  useEffect(() => {
    axios
      .get(
        `http://api.weatherapi.com/v1/current.json?key=10cae7ec92fa4e47ac933047200611&q=pittsburgh`
      )
      .then((res) => {
        const locationRes = res.data.location;
        setWeather(locationRes);
      })
      .catch((err) => {
        console.log("error");
      });
  }, []);
  useEffect(() => {
    axios
      .get(
        `http://api.weatherapi.com/v1/current.json?key=10cae7ec92fa4e47ac933047200611&q=pittsburgh`
      )
      .then((res) => {
        const weatherRes = res.data.current;
        setWeather(weatherRes);
      })
      .catch((err) => {
        console.log("error");
      });
  }, []);

  return (
    <div>
      <h3>{props.locationRes.name}</h3>
    </div>
  );
}
